import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; 

var phantom = {
    display: 'block',
    padding: '20px',
    height: '60px',
    width: '100%',
  }

export default function Cart () {
    return (
        <div>
            <div class="container" style={phantom}>
                <div class="row">
                    <div class="col-4">
                        HI
                    </div>
                </div>
            </div>
        </div>
    );
}
